import React from 'react'

export default class FormDemo extends React.Component{

    constructor(){
        super()
        this.state = {
            value: ''
        }
    }

    render(){
        return(
            <div>
                <form>
                    <input type="text" value={ this.state.value }/>
                </form>
            </div>
        )
    }
}
